import { useState } from "react";
import {
  Box,
  Container,
  Typography,
  TextField,
  Button,
  Paper,
  Grid,
} from "@mui/material";
import { useNavigate } from "react-router-dom";

const CreateAuction = () => {
  const navigate = useNavigate();
  const [formData, setFormData] = useState({
    name: "",
    year: "",
    starting_bid: "",
    buy_now_price: "",
    duration_hours: "",
  });

  const handleSubmit = async (e: React.FormEvent) => {
    e.preventDefault();
    try {
      const token = localStorage.getItem("accessToken");
      const response = await fetch("http://localhost:8000/api/auctions/", {
        method: "POST",
        headers: {
          "Content-Type": "application/json",
          Authorization: `Bearer ${token}`,
        },
        body: JSON.stringify({
          ...formData,
          current_bid: formData.starting_bid,
          year: parseInt(formData.year),
          starting_bid: parseFloat(formData.starting_bid),
          buy_now_price: parseFloat(formData.buy_now_price),
          duration_hours: parseInt(formData.duration_hours),
        }),
      });

      if (response.ok) {
        navigate("/");
      }
    } catch (error) {
      console.error("Failed to create auction:", error);
    }
  };

  return (
    <Box sx={{ py: 4, backgroundColor: "#f5f5f5", minHeight: "100vh" }}>
      <Container maxWidth="md">
        <Paper sx={{ p: 4 }}>
          <Typography variant="h4" gutterBottom>
            Create New Auction
          </Typography>
          <form onSubmit={handleSubmit}>
            <Grid container spacing={3}>
              <Grid item xs={12}>
                <TextField
                  fullWidth
                  label="Car Name"
                  name="name"
                  value={formData.name}
                  onChange={(e) =>
                    setFormData({ ...formData, name: e.target.value })
                  }
                  required
                />
              </Grid>
              <Grid item xs={12} sm={6}>
                <TextField
                  fullWidth
                  label="Year"
                  name="year"
                  type="number"
                  value={formData.year}
                  onChange={(e) =>
                    setFormData({ ...formData, year: e.target.value })
                  }
                  required
                />
              </Grid>
              <Grid item xs={12} sm={6}>
                <TextField
                  fullWidth
                  label="Starting Bid ($)"
                  name="starting_bid"
                  type="number"
                  value={formData.starting_bid}
                  onChange={(e) =>
                    setFormData({ ...formData, starting_bid: e.target.value })
                  }
                  required
                />
              </Grid>
              <Grid item xs={12} sm={6}>
                <TextField
                  fullWidth
                  label="Buy Now Price ($)"
                  name="buy_now_price"
                  type="number"
                  value={formData.buy_now_price}
                  onChange={(e) =>
                    setFormData({ ...formData, buy_now_price: e.target.value })
                  }
                  required
                />
              </Grid>
              <Grid item xs={12} sm={6}>
                <TextField
                  fullWidth
                  label="Duration (hours)"
                  name="duration_hours"
                  type="number"
                  value={formData.duration_hours}
                  onChange={(e) =>
                    setFormData({ ...formData, duration_hours: e.target.value })
                  }
                  required
                />
              </Grid>
              <Grid item xs={12}>
                <Button
                  type="submit"
                  variant="contained"
                  size="large"
                  sx={{
                    backgroundColor: "#ff0000",
                    "&:hover": {
                      backgroundColor: "#cc0000",
                    },
                  }}
                >
                  Create Auction
                </Button>
              </Grid>
            </Grid>
          </form>
        </Paper>
      </Container>
    </Box>
  );
};

export default CreateAuction;
